import React, { useState, useEffect, useCallback } from 'react';
import { adminAPI, mlAPI } from '../services/api';
import '../dashboards/StudentDashboard.css';

function AdminDashboard({ user, onLogout }) {
  const [activeTab, setActiveTab] = useState('overview');
  const [students, setStudents] = useState([]);
  const [teachers, setTeachers] = useState([]);
  const [classes, setClasses] = useState([]);
  const [weakStudents, setWeakStudents] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Memoized fetch function to prevent unnecessary recreations
  const fetchData = useCallback(async () => {
    setLoading(true);
    setError(null);
    try {
      const [studentsRes, teachersRes, classesRes, weakRes] = await Promise.all([
        adminAPI.getStudents(),
        adminAPI.getTeachers(),
        adminAPI.getClasses(),
        mlAPI.getWeakStudents(),
      ]);

      // Map data with fallbacks for empty responses
      setStudents(studentsRes.data || []);
      setTeachers(teachersRes.data || []);
      setClasses(classesRes.data || []);
      setWeakStudents(weakRes.data || []);
    } catch (err) {
      console.error('Fetch Error:', err);
      setError('Failed to load dashboard data. Please check your connection.');

      // If unauthorized, redirect to login
      if (err.response?.status === 401) onLogout();
    } finally {
      setLoading(false);
    }
  }, [onLogout]);

  useEffect(() => {
    if (user) fetchData();
  }, [user, fetchData]);

  if (loading) return <div className="loading-spinner">Loading Evaluation Data...</div>;

  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <div className="header-content">
          <h1>Admin Dashboard</h1>
          <div className="user-info">
            <span>{user?.email}</span>
            <button onClick={onLogout} className="logout-btn">Logout</button>
          </div>
        </div>
      </header>

      {error && (
        <div className="error-banner">
          {error} <button onClick={fetchData}>Retry</button>
        </div>
      )}

      <nav className="dashboard-tabs">
        {['overview', 'students', 'teachers', 'classes'].map((tab) => (
          <button 
            key={tab}
            className={`tab ${activeTab === tab ? 'active' : ''}`} 
            onClick={() => setActiveTab(tab)}
          >
            {tab.charAt(0).toUpperCase() + tab.slice(1)}
          </button>
        ))}
      </nav>

      <main className="dashboard-content">
        {activeTab === 'overview' && (
          <section className="overview-section">
            <div className="stats-grid">
              <StatCard title="Total Students" value={students.length} />
              <StatCard title="Total Teachers" value={teachers.length} />
              <StatCard title="Total Classes" value={classes.length} />
              <StatCard title="At-Risk (ML)" value={weakStudents.length} color="red" />
            </div>

            <div className="chart-container">
              <h3>ML Performance Insights: Students Needing Attention</h3>
              <div className="table-container">
                <table className="data-table">
                  <thead>
                    <tr>
                      <th>Student</th>
                      <th>Avg Grade</th>
                      <th>Risk Probability</th>
                      <th>Attendance</th>
                    </tr>
                  </thead>
                  <tbody>
                    {weakStudents.length > 0 ? weakStudents.map((s) => (
                      <tr key={s.student_id}>
                        <td>{s.student_name}</td>
                        <td>{s.current_average?.toFixed(1)}%</td>
                        <td>
                          <span className={`badge ${s.weak_probability > 0.7 ? 'fail' : 'warning'}`}>
                            {(s.weak_probability * 100).toFixed(0)}% Risk
                          </span>
                        </td>
                        <td>{s.attendance_rate?.toFixed(1)}%</td>
                      </tr>
                    )) : <tr><td colSpan="4">No high-risk students identified.</td></tr>}
                  </tbody>
                </table>
              </div>
            </div>
          </section>
        )}

        {/* --- Management Sections --- */}
        {activeTab === 'students' && <DataTable title="Students" headers={['Name', 'Email', 'Class', 'Roll No']} data={students} type="students" />}
        {activeTab === 'teachers' && <DataTable title="Teachers" headers={['Name', 'Email', 'Dept', 'Phone']} data={teachers} type="teachers" />}
      </main>
    </div>
  );
}

// Sub-components for cleaner code
const StatCard = ({ title, value, color }) => (
  <div className="stat-card">
    <h3>{title}</h3>
    <div className="stat-value" style={{ color: color }}>{value}</div>
  </div>
);

const DataTable = ({ title, headers, data, type }) => (
  <div className="marks-section">
    <h2>{title} Management</h2>
    <div className="table-container">
      <table className="data-table">
        <thead>
          <tr>{headers.map(h => <th key={h}>{h}</th>)}</tr>
        </thead>
        <tbody>
          {data.length > 0 ? data.map((item) => (
            <tr key={item.id}>
              {type === 'students' ? (
                <>
                  <td>{item.first_name} {item.last_name}</td>
                  <td>{item.email}</td>
                  <td>{item.class_name}</td>
                  <td>{item.roll_number}</td>
                </>
              ) : (
                <>
                  <td>{item.first_name} {item.last_name}</td>
                  <td>{item.email}</td>
                  <td>{item.department}</td>
                  <td>{item.phone}</td>
                </>
              )}
            </tr>
          )) : <tr><td colSpan={headers.length}>No data available</td></tr>}
        </tbody>
      </table>
    </div>
  </div>
);

export default AdminDashboard;
